-- ************************************** `location info`
CREATE TABLE locationinfo
(
 location_id    number(10) NOT NULL PRIMARY KEY,
 street_address clob NOT NULL,
 postal_code    number(10) NOT NULL,
 city           clob NOT NULL,
 state_province clob,
 phone_number   clob NOT NULL,
 country_id     number(10) NOT NULL
);

-- ************************************** `countries`
CREATE TABLE countries
(
 country_id   number(10) NOT NULL PRIMARY KEY,
 country_name clob NOT NULL,
 region_id    number(10) NOT NULL
);

CREATE TABLE region
(
 region_id   number(10) NOT NULL PRIMARY KEY,
 region_name clob NOT NULL
);

-- ************************************** `hospital info`
CREATE TABLE hospitalinfo
(
 hospital_id   number(10) NOT NULL PRIMARY KEY,
 hospital_name clob NOT NULL,
 location_id   number(10) NOT NULL,
 review_ids    clob
);

-- ************************************** `reviews`
CREATE TABLE reviews
(
 review_id          number(10) NOT NULL PRIMARY KEY,
 review_title       clob NOT NULL,
 review_description clob NOT NULL
);

-- ************************************** `service info`
CREATE TABLE serviceinfo
(
 service_id              number(10) NOT NULL PRIMARY KEY,
 hospital_procedure_code clob,
 service_name            clob,
 service_description     clob,
 charge                  binary_double,
 date_updated            date,
 hospital_id             number(10) NOT NULL,
 review_ids    			 clob,
 HCPCS_id                clob
);

-- ************************************** `HCPCS Codes Codes`
CREATE TABLE HCPCSCodes
(
 HCPCS_id                 clob NOT NULL,
 mod_code                 clob,
 description              clob,
 laboratory_certification clob
);

-- ************************************** `doctor`
CREATE TABLE doctors
(
 doctor_id     number(10) NOT NULL PRIMARY KEY,
 license_id    clob,
 first_name    clob NOT NULL,
 last_name     clob NOT NULL,
 hostpital_ids clob NOT NULL,
 review_ids    clob,
 service_ids   clob
);

-- ************************************** `users`
CREATE TABLE users
(
 unique_id    number(10) NOT NULL PRIMARY KEY,
 email        clob NOT NULL,
 username     clob NOT NULL,
 password     clob NOT NULL,
 date_created timestamp(0) NOT NULL,
 review_ids   clob
);

-- ** ALTER TABLES AND ASSIGN FOREIGN KEYS ** --
ALTER TABLE locationinfo ADD CONSTRAINT country_fk FOREIGN KEY (country_id) REFERENCES countries(country_id);

ALTER TABLE countries ADD CONSTRAINT region_fk FOREIGN KEY (region_id) REFERENCES region(region_id);

ALTER TABLE hospitalinfo ADD CONSTRAINT location_fk FOREIGN KEY (location_id) REFERENCES locationinfo(location_id);

ALTER TABLE serviceinfo ADD CONSTRAINT hospital_fk FOREIGN KEY (hospital_id) REFERENCES hospitalinfo(hospital_id);

--ALTER TABLE serviceinfo ADD CONSTRAINT HCPCSCodes_fk FOREIGN KEY (HCPCS_id) REFERENCES HCPCSCodes(HCPCS_id);

-- ** ALTER TABLES AND ASSIGN AUTO INCREMENTS KEYS ** --
CREATE SEQUENCE user_seq START WITH 1 INCREMENT BY 1;

CREATE SEQUENCE location_seq START WITH 1 INCREMENT BY 1;

CREATE SEQUENCE region_seq START WITH 1 INCREMENT BY 1;

-- CREATE SEQUENCE hospital_seq START WITH 1 INCREMENT BY 1;

CREATE SEQUENCE review_seq START WITH 1 INCREMENT BY 1;

CREATE SEQUENCE service_seq START WITH 1 INCREMENT BY 1;

CREATE SEQUENCE doctor_seq START WITH 1 INCREMENT BY 1;

-- ** CREATE TIGGERS ** --
CREATE OR REPLACE TRIGGER user_seq 
	BEFORE INSERT ON users 
	FOR EACH ROW
	WHEN (new.unique_id IS NULL)
BEGIN
	SELECT user_seq.NEXTVAL
	INTO :new.unique_id
	FROM dual;
END;
/

CREATE OR REPLACE TRIGGER region_seq 
	BEFORE INSERT ON region 
	FOR EACH ROW
	WHEN (new.region_id  IS NULL)
BEGIN
	SELECT region_seq.NEXTVAL
	INTO :new.region_id 
	FROM dual;
END;
/
