-- ** VIEWS FOR DIFFERENT THINGS ** --

-- View for finding all the different types of x-rays --
create view xray as select s.service_name as "Service Name", s.charge as "Price" from serviceinfo s where upper(s.service_name) like upper('%x-ray%') or upper(s.service_name) like upper('%x ray%') or upper(s.service_name) like upper('%xray%');

-- Display all hostpitals in the US --
create view usHospitalInfo as select h.hospital_name as "Hospital Name", l.street_address as "Address", l.city as "City", l.state_province as "State", l.postal_code as "Postal Code", l.phone_number as "Phone Number" from locationinfo l, hospitalinfo h where (l.location_id = h.location_id) and l.country_id=840;

-- View all services with the hcpcs id of something --
create view serviceinfo as select s.service_name as "Service Name", s.charge as "Price", hc.description as "HCPCS Des" from serviceinfo s, HCPCSCodes hc where upper(s.HCPCS_id) like upper('Z7610');


-- Selections of random things --
select service_name as "Service Name", charge as "Price" from serviceinfo where charge>5000;

select service_name as "Service Name", charge as "Price", service_description as "Description" from serviceinfo where upper(hospital_procedure_code) like upper('06600019');

select HCPCS_id as "HCPCS Code", description as "Description" from HCPCSCodes where upper(HCPCS_id) like upper('Z7610');


-- Delete things! DELETES EVERYTHING --            
BEGIN
    FOR const IN ( SELECT TABLE_NAME, CONSTRAINT_NAME
               FROM USER_CONSTRAINTS
               WHERE CONSTRAINT_TYPE IN ('R', 'C') /*Foreign Key and Check constraints.*/ )
    LOOP
        EXECUTE IMMEDIATE 'ALTER TABLE '||const.TABLE_NAME ||' DROP CONSTRAINT '||const.CONSTRAINT_NAME;
        DBMS_OUTPUT.PUT_LINE('Dropped constraint '||const.CONSTRAINT_NAME||' of table '||const.TABLE_NAME); 
    END LOOP;
END;
/

BEGIN
  --Bye Sequences!
  FOR i IN (SELECT us.sequence_name
              FROM USER_SEQUENCES us) LOOP
    EXECUTE IMMEDIATE 'drop sequence '|| i.sequence_name ||'';
  END LOOP;
  --Bye Tables!
  FOR i IN (SELECT ut.table_name
              FROM USER_TABLES ut) LOOP
    EXECUTE IMMEDIATE 'drop table '|| i.table_name ||' CASCADE CONSTRAINTS ';
  END LOOP;

END;
/

BEGIN  
  FOR i in (select trigger_name,owner 
              from dba_triggers 
             where trigger_name like '%_BI%' and owner = 'myTesting' ) LOOP  
    EXECUTE IMMEDIATE 'DROP TRIGGER '||i.owner||'.'||i.trigger_name;  
  END LOOP;  
END;
